        private void AddMap(MigrationBuilder mb, string name, bool wrap, string[] asciiArray) {
            name = name.Replace("'", "''");
            var ascii = string.Join(" + CAST(CHAR(10) AS NVARCHAR(MAX)) + ",
                asciiArray.Select(x => "N'" + x.Replace("'", "''") + "'").ToList());
            var sql = "INSERT INTO [Map] ([PlayerId], [Name], [Wrap], [Ascii]) " +
                     $"VALUES (NULL, N'{name}', {(wrap ? 1 : 0)}, {ascii});";
            mb.Sql(sql);
        }

